let visualizationImages = {}

visualizationImages['dotplot'] = require('../assets/scatterplot.jpg')
const linechart = require('../assets/linechart.jpg')
const barchart = require('../assets/barchart.jpg')
const heatmap = require('../assets/heatmap.jpg')
const categoricalbarchart = require('../assets/categoricalbarchart.jpg')
const areachart = require('../assets/areachart.jpg')
const areaheatmap = require('../assets/areaheatmap.jpg')
const categoricalareachart  = require('../assets/categoricalareachart.jpg')
const annotation  = require('../assets/annotation.jpg')



export const encodingOptions = [scatterplot,linechart,barchart,heatmap,categoricalbarchart,areachart,areaheatmap,categoricalareachart,annotation]
